const myLayout = {name: "preset"};
    
const cy = cytoscape({
  container: document.getElementById('cy'),
  elements: myElements,
  style: pfamStyleSheet,
  layout: myLayout,
  zoom: 1,
  zoomingEnabled: false,
  autolock: true,
  panningEnabled: false,
  boxSelectionEnabled: false,
  pixelRatio: window.devicePixelRatio,
  ready: function(){window.cy = this;}
});

const currentStyle = cy.style().json();
    
cy.on('mouseover', 'node', function(evt){
  const thisNode = evt.target;

  cy.style().fromJson(currentStyle).update();
  
  cy.style().selector(thisNode).style({
    'label': 'data(id)',
    'width': 30,
    'height': 30,
    'text-outline-color': 'white',
    'text-outline-width': 2,
    'text-halign': 'right',
    'text-margin-x': 2,
    'text-margin-y': -6,
    'text-valign': 'center',
    'z-index': 3,
    'font-size': 15,
    'font-weight': 'bold'
  }).update();	
});

    
cy.on('mouseover', 'edge', function(evt){
  const thisEdge = evt.target;
  const thisSource = thisEdge.source();
  const thisTarget = thisEdge.target();
  
  let sourceHalign, targetHalign;

  if (thisSource.position('x') >= thisTarget.position('x')) {
    sourceHalign = 'right';
    targetHalign = 'left'; 
  } else {
    sourceHalign = 'left';
    targetHalign = 'right';
  }
  
  let sourceValign, targetValign;
  let sourceMarginY, targetMarginY;

  if (thisSource.position('y') <= thisTarget.position('y')) {
    sourceValign = 'top';
    targetValign = 'bottom';
    sourceMarginY = 10;
    targetMarginY = -16;
  } else {
    sourceValign = 'bottom';
    targetValign = 'top';
    sourceMarginY = -20;
    targetMarginY = 8;
  }
  
  cy.style().fromJson(currentStyle).update();
  
  cy.style().selector(thisSource).style({
    'label': 'data(id)',
    'width': 30,
    'height': 30,
    'text-outline-color': 'white',
    'text-outline-width': 2,
    'text-halign': sourceHalign,
    'text-valign': sourceValign,
    'text-margin-y': sourceMarginY,
    'z-index': 3,
    'font-size': 15,
    'font-weight': 'bold'
  }).update();

  cy.style().selector(thisTarget).style({
    'label': 'data(id)',
    'width': 30,
    'height': 30,
    'text-outline-color': 'white',
    'text-outline-width': 2,
    'text-halign': targetHalign,
    'text-valign': targetValign,
    'text-margin-y': targetMarginY,
    'z-index': 3,
    'font-size': 15,
    'font-weight': 'bold'
  }).update();

  cy.style().selector(thisEdge).style({
    'opacity': 1,
    'width': 3,
    'label': 'data(id)',
    'text-outline-color': 'white',
    'text-outline-width': 2,
    'z-index': 4,
    'font-size': 15,
    'font-weight': 'bold'
  }).update();
});
